PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "BTC_USDT_candles" (
"timestamp" INTEGER,
  "open" REAL,
  "high" REAL,
  "low" REAL,
  "close" REAL,
  "volume" REAL
);
CREATE TABLE IF NOT EXISTS "ETH_USDT_candles" (
"timestamp" INTEGER,
  "open" REAL,
  "high" REAL,
  "low" REAL,
  "close" REAL,
  "volume" REAL
);
CREATE TABLE IF NOT EXISTS "XRP_USDT_candles" (
"timestamp" INTEGER,
  "open" REAL,
  "high" REAL,
  "low" REAL,
  "close" REAL,
  "volume" REAL
);
CREATE TABLE candles (
                    symbol TEXT,
                    timestamp INTEGER,
                    open REAL,
                    high REAL,
                    low REAL,
                    close REAL,
                    volume REAL,
                    PRIMARY KEY (symbol, timestamp)
                );
CREATE TABLE trades (
                    symbol TEXT,
                    entry_time INTEGER,
                    exit_time INTEGER,
                    entry_price REAL,
                    exit_price REAL,
                    size REAL,
                    leverage REAL,
                    profit_loss REAL,
                    features_used TEXT,
                    timeframes TEXT,
                    side TEXT
                );
CREATE TABLE JASMY_USDT_candles (
                    timestamp INTEGER PRIMARY KEY,
                    open REAL,
                    high REAL,
                    low REAL,
                    close REAL,
                    volume REAL
                );
CREATE TABLE WIF_USDT_candles (
                    timestamp INTEGER PRIMARY KEY,
                    open REAL,
                    high REAL,
                    low REAL,
                    close REAL,
                    volume REAL
                );
CREATE TABLE KAS_USDT_candles (
                    timestamp INTEGER PRIMARY KEY,
                    open REAL,
                    high REAL,
                    low REAL,
                    close REAL,
                    volume REAL
                );
COMMIT;
